import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  function handleClick(e) {
    e.preventDefault();
    console.log('The link was clicked.');
  }
  return (
    <a href="#" onClick={handleClick}>
      Click me
    </a>
  );






}

export default App;
